ype\":\"application/octet-stream\",\"lastModified\":1539812954000,\"length\":1872412,\"url\":\"https://earthquake.usgs.gov/product/finite-fault/us20005iis/us/1539812954400/waveplots.zip\",\"sha256\":\"uoO9yYnrphMtZ4S3libPUTdaAsE9IZbhURH5lgNNp4g=\"},\"moment_rate.png\":{\"contentType\":\"application/octet-stream\",\"lastModified\":1486189391000,\"length\":116209,\"url\":\"https://earthquake.usgs.gov/product/finite-fault/us20005iis/us/1539812954400/moment_rate.png\",\"sha256\":\"BbKmJ9AqEv6vRnVMHYBttKSaR7YInqPlHvlkhaEKOxU=\"},\"CMTSOLUTION\":{\"contentType\":\"application/octet-stream\",\"lastModified\":1486189365000,\"length\":6151,\"url\":\"https://earthquake.usgs.gov/product/finite-fault/us20005iis/us/1539812954400/CMTSOLUTION\",\"sha256\":\"EnVMkxCij0tdwmxcIdSPo0fVNgAjKXFSJ4Ax+ahLeCg=\"},\"complete_inversion.fsp\":{\"contentType\":\"application/octet-stream\",\"lastModified\":1486189369000,\"length\":17184,\"url\":\"https://earthquake.usgs.gov/product/finite-fault/us20005iis/us/1539812954400/complete_inversion.fsp\",\"sha256\":\"emb7AK7Uv6pl1Jo0DVTEuS5alVzkzl+3PpJ8WFory+w=\"},\"finite_fault.kml\":{\"contentType\":\"application/octet-stream\",\"lastModified\":1486189358000,\"length\":2111,\"url\":\"https://earthquake.usgs.gov/product/finite-fault/us20005iis/us/1539812954400/finite_fault.kml\",\"sha256\":\"WYztANvaOqN4rFT8MDwk1cBS9fv4ZC5Lyrr1Z3skOQo=\"},\"analysis.html\":{\"contentType\":\"text/html\",\"lastModified\":1539812950000,\"length\":237,\"url\":\"https://earthquake.usgs.gov/product/finite-fault/us20005iis/us/1539812954400/analysis.html\",\"sha256\":\"pPgW+HkeOBtl0h+GeC4DJ0NyrI7nfTmmzaweM3tMfGk=\"}}}],\"general-text\":[{\"indexid\":\"13440389\",\"indexTime\":1610474266263,\"id\":\"urn:usgs-product:admin:general-text:us20005iis-1460740000155:1460753528261\",\"type\":\"general-text\",\"code\":\"us20005iis-1460740000155\",\"source\":\"admin\",\"updateTime\":1460753528261,\"status\":\"UPDATE\",\"properties\":{\"eventsource\":\"us\",\"eventsourcecode\":\"20005iis\",\"original-signature\":\"MCwCFFnVRQ4xzSDNT2pMPlcWQYenem0NAhR6eBfuhcUoLaP5xHS3XHOKYLVG0Q==\",\"original-signature-version\":\"v1\",\"review-status\":\"Reviewed\",\"senderemail\":\"\"},\"preferredWeight\":1,\"contents\":{\"\":{\"contentType\":\"1\",\"lastModified\":1460753528000,\"length\":2074,\"bytes\":\"<h2>Tectonic
        Summary</h2>\\n<p>\\nThe April 15, 2016 M 7.0 earthquake north of Kumamoto,
        on the island of Kyushu in southwest Japan, occurred as the result of strike-slip
        faulting at shallow depth. Focal mechanisms for the earthquake indicate slip
        occurred on either a left-lateral fault striking to the northwest, or on a
        right-lateral fault striking northeast. While the earthquake occurred several
        hundred kilometers northwest of the Ryukyu Trench, where the Philippine Sea
        plate begins its northwestward subduction beneath Japan and the Eurasia plate,
        the shallow depth and faulting mechanism of this earthquake indicate it occurred
        on a crustal fault within the upper Eurasia plate.  At the location of this
        event, the Philippine Sea plate converges with Eurasia towards the northwest
        at a velocity of 58 mm/yr. \\n</p><p>\\nThe April 15, 2016, M 7.0 event (UTC
        16:25:06) occurred one day after a series of foreshocks in the same region,
        which included M 6.2 and M 6.0 earthquakes. The April 14 events resulted in
        at least 9 fatalities and over 800 injuries. \\n</p><p>\\nIn contrast to this
        recent sequence of shallow earthquakes, most seismicity in the Kyushu region
        is related to the subduction of the Philippine Sea plate at depth. Just thirteen
        M 5+ earthquakes have occurred at shallow depths (< 50 km) within 100 km of
        the April 2016 events over the preceding century. In January and April of
        1975, two shallow events with magnitudes of M 5.8 and M 6.1 - 40 km and 65
        km to the northwest of the April 2016 earthquake, respectively \u2013 caused
        injuries, but no known fatalities. A shallow M 6.6 earthquake in March 2005,
        just off the north coast of Kyushu and 110 km north of the April 2016 event,
        caused over 1000 injuries and at least one fatality. \\n</p><p>\\nMapped faults
        in the region generally trend east-west or northeast-southwest, in agreement
        with the right-lateral plane of preliminary focal mechanisms, and the trend
        of early aftershocks. Since the April 14, M 6.2 event (12:26:36 UTC), 19 other
        shocks have been located, including the latest M 7.0 earthquake. \\n</p>\",\"sha256\":\"1dCxjwSNdgiO5Hrnfpmvql70K08ROVFwkq5dZzwEjhs=\"}}}],\"ground-failure\":[{\"indexid\":\"13685014\",\"indexTime\":1610489999823,\"id\":\"urn:usgs-product:us:ground-failure:20005iis:1597451794387\",\"type\":\"ground-failure\",\"code\":\"20005iis\",\"source\":\"us\",\"updateTime\":1597451794387,\"status\":\"UPDATE\",\"properties\":{\"depth\":\"10.0\",\"eventsource\":\"us\",\"eventsourcecode\":\"20005iis\",\"eventtime\":\"2016-04-15T16:25:06.000Z\",\"landslide-alert\":\"orange\",\"landslide-hazard-1std\":\"54.19050021189107,
