        Information Bulletin from the PTWC\",\"url\":\"http://www.weather.gov/ptwc/index.php?region=1\",\"version\":\"01\"},\"preferredWeight\":6,\"contents\":[]}],\"impact-text\":[{\"indexid\":\"13394553\",\"indexTime\":1610469572882,\"id\":\"urn:usgs-product:us:impact-text:us20005iis:1467068498040\",\"type\":\"impact-text\",\"code\":\"us20005iis\",\"source\":\"us\",\"updateTime\":1467068498040,\"status\":\"UPDATE\",\"properties\":{\"eventParametersPublicID\":\"quakeml:us.anss.org/eventparameters/20005iis/1467068504\",\"eventsource\":\"us\",\"eventsourcecode\":\"20005iis\",\"original-signature\":\"MC0CFF4qwxc+MMYyrqghgZ3UkEopG7iBAhUArC3JX01XQ+gNDbZiW5katSKNros=\",\"original-signature-version\":\"v1\"},\"preferredWeight\":8,\"contents\":{\"\":{\"contentType\":\"text/plain\",\"lastModified\":1467068498000,\"length\":1000,\"bytes\":\"At
        least 40 people killed, 2,021 injured, 12,550 houses damaged or destroyed
        and 445 public buildings damaged or destroyed in Kumamoto and Oita. The Aso
        Shrine and Kumamoto Castle were heavily damaged. The Aso Ohashi bridge in
        Minamiaso collapsed into the Kurokawa River from a quake-triggered landslide.
        The Kyushu Shinkansen train service was suspended after a train derailed.
        Roads cracked, water lines were damaged and power outages occurred. Surface
        faulting observed in a zone about 34 km long with a maximum offset of about
        2.2 m.  Damage estimated at 12 billion US dollars. Felt (VIII) at Kumamoto.
        Felt throughout Kyushu. Felt (IV) at Osaka and (III) at Hiroshima, Honshu.
        Felt in Chiba, Hyogo, Nara, Shimane, Tokyo and Yamaguchi. Also felt in Ehime,
        Shikoku. Felt (III) at Busan, South Korea. Felt in many parts of South Korea.
        Also felt at Suzhou, China. Recorded (6U JMA) in Kumamoto. Recorded (5L JMA)
        in Ehime, Shikoku and (4 JMA) in Hiroshima, Shimane, Tottori and Yamaguchi,
        Honshu.\\n\\n\",\"sha256\":\"LQXQbcKlGxDgzqQkTTc7KDZlCCDrCAb5IdgWYlcEPZQ=\"}}}],\"losspager\":[{\"indexid\":\"12030119\",\"indexTime\":1610341765137,\"id\":\"urn:usgs-product:us:losspager:us20005iis:1467057329697\",\"type\":\"losspager\",\"code\":\"us20005iis\",\"source\":\"us\",\"updateTime\":1467057329697,\"status\":\"UPDATE\",\"properties\":{\"alertlevel\":\"red\",\"depth\":\"10.0\",\"eventsource\":\"us\",\"eventsourcecode\":\"20005iis\",\"eventtime\":\"2016-04-15T16:25:06.000Z\",\"latitude\":\"32.7906\",\"longitude\":\"130.754\",\"magnitude\":\"7.0\",\"maxmmi\":\"9.0\",\"original-signature\":\"MCwCFB45alTqLDuBSmrOXCo7HG6abm1cAhRH0BeQv3/5hmFrE5Sot98t+v1jaQ==\",\"original-signature-version\":\"v1\"},\"preferredWeight\":158,\"contents\":{\"onepager.pdf\":{\"contentType\":\"application/octet-stream\",\"lastModified\":1467057327000,\"length\":529343,\"url\":\"https://earthquake.usgs.gov/product/losspager/us20005iis/us/1467057329697/onepager.pdf\",\"sha256\":\"4wvPAemetjv9gVsqqVsIOynq0oCGAMlnV6hzkca3dcA=\"},\"location.png\":{\"contentType\":\"application/octet-stream\",\"lastModified\":1467057327000,\"length\":17590,\"url\":\"https://earthquake.usgs.gov/product/losspager/us20005iis/us/1467057329697/location.png\",\"sha256\":\"zjKyCucSs9nw5xMblFGf5SVZsDsYHtneWZFEnhWxYSA=\"},\"empprob.png\":{\"contentType\":\"application/octet-stream\",\"lastModified\":1467057327000,\"length\":27676,\"url\":\"https://earthquake.usgs.gov/product/losspager/us20005iis/us/1467057329697/empprob.png\",\"sha256\":\"EHtG+dv7akGTxEXrPulOuMxzi7z3i8g3h9FsEefocwo=\"},\"expolegend.pdf\":{\"contentType\":\"application/octet-stream\",\"lastModified\":1467057327000,\"length\":124606,\"url\":\"https://earthquake.usgs.gov/product/losspager/us20005iis/us/1467057329697/expolegend.pdf\",\"sha256\":\"SPWl878ZmZ2K7TYjBQoYtq77xR5Zbeg65kWzTbSfArg=\"},\"semifat.png\":{\"contentType\":\"application/octet-stream\",\"lastModified\":1467057327000,\"length\":95281,\"url\":\"https://earthquake.usgs.gov/product